class ClassLogger{constructor(){this._Enabled=!0}set Enabled(flag){return"boolean"==typeof flag&&(this._Enabled=flag,!0)}get LogLevel(){return{INFO:"INFO",DEBUG:"DEBUG",ERROR:"ERROR",WARN:"WARN"}}Log(qlfier,msg){if(this._Enabled)return!!this.LogLevel[qlfier]&&(console.log(`[${Process.GetSystemTime()}] ${qlfier}>> ${msg}`),!0)}}exports=ClassLogger;